import React from 'react';
import styled from 'styled-components';
import Item from './Item';

const SliderBox = styled.div`
  display: flex;
`;

function Slider({ data }) {
  return (
    <SliderBox>
      {data.map((el) => (
        <Item />
      ))}
    </SliderBox>
  );
}

export default Slider;
